    const [count, setCount] = useState(0)

    const handleCount = () => {
        setCount(count + 1)
    }

    useEffect(() => {
        console.log('Урааа')
    }, [count])


    return(
        <>
            <Header/>
            <Test text={'Hell world'}/>
            {count}
            <button onClick={handleCount}>Count</button>
        </>
    )
}


export default MainPage;
